import React from 'react';
import { motion } from 'framer-motion';
import { Brain, Database, Code, Cloud, BarChart3, Zap } from 'lucide-react';

const Skills: React.FC = () => {
  const skillCategories = [
    {
      title: 'Machine Learning',
      icon: Brain,
      skills: [
        { name: 'TensorFlow', level: 90 },
        { name: 'PyTorch', level: 85 },
        { name: 'Scikit-learn', level: 95 },
        { name: 'Keras', level: 80 },
        { name: 'OpenCV', level: 85 },
        { name: 'NLTK', level: 75 },
      ]
    },
    {
      title: 'Data Science',
      icon: BarChart3,
      skills: [
        { name: 'Pandas', level: 95 },
        { name: 'NumPy', level: 90 },
        { name: 'Matplotlib', level: 85 },
        { name: 'Seaborn', level: 80 },
        { name: 'Jupyter', level: 95 },
        { name: 'Tableau', level: 70 },
      ]
    },
    {
      title: 'Programming',
      icon: Code,
      skills: [
        { name: 'Python', level: 95 },
        { name: 'R', level: 80 },
        { name: 'SQL', level: 85 },
        { name: 'JavaScript', level: 70 },
        { name: 'Java', level: 65 },
        { name: 'C++', level: 60 },
      ]
    },
    {
      title: 'Data Engineering',
      icon: Database,
      skills: [
        { name: 'Apache Spark', level: 80 },
        { name: 'Hadoop', level: 75 },
        { name: 'Kafka', level: 70 },
        { name: 'Airflow', level: 75 },
        { name: 'MongoDB', level: 80 },
        { name: 'PostgreSQL', level: 85 },
      ]
    },
    {
      title: 'Cloud & DevOps',
      icon: Cloud,
      skills: [
        { name: 'AWS', level: 85 },
        { name: 'Docker', level: 80 },
        { name: 'Kubernetes', level: 70 },
        { name: 'MLflow', level: 75 },
        { name: 'Git', level: 90 },
        { name: 'CI/CD', level: 75 },
      ]
    },
    {
      title: 'MLOps',
      icon: Zap,
      skills: [
        { name: 'Model Deployment', level: 85 },
        { name: 'A/B Testing', level: 80 },
        { name: 'Monitoring', level: 75 },
        { name: 'Feature Stores', level: 70 },
        { name: 'Model Versioning', level: 80 },
        { name: 'AutoML', level: 75 },
      ]
    }
  ];

  return (
    <section id="skills" className="section-padding bg-secondary-50">
      <div className="max-w-7xl mx-auto">
        <motion.div
          initial={{ opacity: 0, y: 30 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8 }}
          viewport={{ once: true }}
          className="text-center mb-16"
        >
          <h2 className="text-4xl font-bold gradient-text mb-4">Skills & Expertise</h2>
          <p className="text-lg text-secondary-600 max-w-2xl mx-auto">
            Comprehensive technical skills across the entire machine learning and data science stack
          </p>
        </motion.div>

        <div className="grid md:grid-cols-2 lg:grid-cols-3 gap-8">
          {skillCategories.map((category, categoryIndex) => (
            <motion.div
              key={category.title}
              initial={{ opacity: 0, y: 30 }}
              whileInView={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.6, delay: categoryIndex * 0.1 }}
              viewport={{ once: true }}
              className="card"
            >
              <div className="flex items-center space-x-3 mb-6">
                <div className="p-2 bg-primary-100 rounded-lg">
                  <category.icon size={24} className="text-primary-600" />
                </div>
                <h3 className="text-xl font-bold text-secondary-900">{category.title}</h3>
              </div>

              <div className="space-y-4">
                {category.skills.map((skill, skillIndex) => (
                  <motion.div
                    key={skill.name}
                    initial={{ opacity: 0, x: -20 }}
                    whileInView={{ opacity: 1, x: 0 }}
                    transition={{ duration: 0.4, delay: skillIndex * 0.05 }}
                    viewport={{ once: true }}
                  >
                    <div className="flex justify-between items-center mb-2">
                      <span className="text-sm font-medium text-secondary-700">{skill.name}</span>
                      <span className="text-sm text-primary-600 font-semibold">{skill.level}%</span>
                    </div>
                    <div className="w-full bg-secondary-200 rounded-full h-2">
                      <motion.div
                        initial={{ width: 0 }}
                        whileInView={{ width: `${skill.level}%` }}
                        transition={{ duration: 1, delay: skillIndex * 0.1 }}
                        viewport={{ once: true }}
                        className="bg-gradient-to-r from-primary-500 to-accent-500 h-2 rounded-full"
                      />
                    </div>
                  </motion.div>
                ))}
              </div>
            </motion.div>
          ))}
        </div>

        {/* Additional Skills */}
        <motion.div
          initial={{ opacity: 0, y: 30 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8 }}
          viewport={{ once: true }}
          className="mt-16 text-center"
        >
          <h3 className="text-2xl font-bold text-secondary-900 mb-6">Additional Skills</h3>
          <div className="flex flex-wrap justify-center gap-3">
            {[
              'Deep Learning', 'Computer Vision', 'Natural Language Processing', 'Reinforcement Learning',
              'Time Series Analysis', 'Statistical Modeling', 'Data Visualization', 'Big Data Processing',
              'Model Optimization', 'Neural Networks', 'Ensemble Methods', 'Feature Engineering',
              'Hyperparameter Tuning', 'Cross-validation', 'Data Preprocessing', 'Model Interpretability'
            ].map((skill) => (
              <span
                key={skill}
                className="px-4 py-2 bg-white border border-secondary-200 rounded-full text-sm font-medium text-secondary-700 hover:border-primary-300 hover:text-primary-600 transition-colors duration-200"
              >
                {skill}
              </span>
            ))}
          </div>
        </motion.div>
      </div>
    </section>
  );
};

export default Skills;
